import './Rank.scss';
import React from "react";
import ListView from './ListView';

const Box = (props) => {
  const box_name = props.name;
  var text="";
  if (box_name=="fact-box"){
    text="fact";
  } else if (box_name=="conv-box") {
    text="conv";
  } else {
    text="false";
  }

  return(
    <div>
      <div class={box_name}></div>
      <div></div>
    </div>

  )
}

function Rank() {
  return (
    <div className="Rank">
      <h1>Rank Page</h1>
      <Box name="fact-box"></Box>
      <Box name="conv-box"></Box>
      <Box name="false-box"></Box>
      <ListView />
    </div>
  );
}

export default Rank;
